import React from "react";
import styled from "styled-components";

const Todo = () => {
  return <Wrapper>Todo</Wrapper>;
};

export default Todo;

const Wrapper = styled.div`
  border: 1px solid black;
  background: lightblue;
  width: 100%;
`;
